import React from 'react';
interface Iprops {
    setToken: (arg0: IState) => void;
}
interface IState {
    username: string;
    password: string;
}
const initialState = {
    username: '',
    password: '',
};

export default function Login(props: Iprops) {
    const [state, setState] = React.useState<IState>(initialState);
    const handleSubmit = (e: { preventDefault: () => void }) => {
        e.preventDefault();
        if (state.username && state.password && state.password.length > 6) {
            props.setToken({ ...state });
        } else {
            console.log('that bai');
        }
    };
    return (
        <div className="bg">
            <div className="login-wrapper">
                <form>
                    <label>
                        <p>Username</p>
                        <input
                            type="text"
                            onChange={(e) =>
                                setState((pre) => ({
                                    ...pre,
                                    username: e.target.value,
                                }))
                            }
                        />
                    </label>
                    <label>
                        <p>Password</p>
                        <input
                            type="password"
                            onChange={(e) =>
                                setState((pre) => ({
                                    ...pre,
                                    password: e.target.value,
                                }))
                            }
                        />
                    </label>
                    <div>
                        <button type="submit" onClick={handleSubmit}>
                            Submit
                        </button>
                    </div>
                </form>
            </div>
        </div>
    );
}
